import React from 'react';

import './TasksList.scss';

import Button from '../Button/Button';

interface Props {
    listTitle: string;
    listQuantity: number;
}

const TasksList = (props: Props): JSX.Element => {
    return (
        <div className="taskslist">
            <div className="taskslist__title">{props.listTitle}</div>
            <div className="taskslist__quantity">{props.listQuantity}</div>
            <div className="taskslist__content"></div>
            <Button buttonText="+ Add Task" />
        </div>
    );
}

export default TasksList;
